import React from 'react'
import { connect } from 'react-redux'

let ProductsList = ({ products }) => {
    return (
        <div>
            <span>{JSON.stringify(products)}</span>
        </div>
    )
}

const mapStateToProps = (state) => ({
    products: state.json,
})

export default connect(
    mapStateToProps,
    null
)(ProductsList)
